import pandas as pd
import numpy as np
from scipy import stats
import matplotlib.pyplot as plt
import seaborn as sns

def prepare_data(file_path):
    data = pd.read_csv('https://raw.githubusercontent.com/Arjun-08/Effects-of-smoking/refs/heads/main/Raw%20Data_GeneSpring%20(1).txt', delimiter='\t')

    metadata_cols = ['GeneSymbol', 'EntrezGeneID', 'Go']  # Identify metadata columns
    data_cols = [col for col in data.columns if col not in metadata_cols]

    data_melted = data.melt(id_vars=metadata_cols, value_vars=data_cols, var_name='Sample', value_name='Expression') # Melt the dataframe

    # Extract gender and smoking status from sample names
    data_melted[['Gender', 'SmokingStatus']] = data_melted['Sample'].str.extract(r'_(M|F)_(Ns|Sm)')
    data_melted['SmokingStatus'] = data_melted['SmokingStatus'].map({'Ns': 'Non-smoker', 'Sm': 'Smoker'})

    return data_melted

def perform_anova(data):
    genes = data['GeneSymbol'].unique()
    p_values = []

    for gene in genes:
        gene_data = data[data['GeneSymbol'] == gene]

        # Data preparation for ANOVA
        smoker_male = gene_data[(gene_data['Gender'] == 'M') & (gene_data['SmokingStatus'] == 'Smoker')]['Expression']
        smoker_female = gene_data[(gene_data['Gender'] == 'F') & (gene_data['SmokingStatus'] == 'Smoker')]['Expression']
        nonsmoker_male = gene_data[(gene_data['Gender'] == 'M') & (gene_data['SmokingStatus'] == 'Non-smoker')]['Expression']
        nonsmoker_female = gene_data[(gene_data['Gender'] == 'F') & (gene_data['SmokingStatus'] == 'Non-smoker')]['Expression']

        groups = [smoker_male, smoker_female, nonsmoker_male, nonsmoker_female]

        if all(len(group) > 0 for group in groups) and all(np.std(group) > 0 for group in groups):
            try:
                f_val, p_val = stats.f_oneway(smoker_male, smoker_female, nonsmoker_male, nonsmoker_female) # Perform two-way ANOVA
                p_values.append(p_val)
            except ValueError:
                p_values.append(np.nan)
        else:
            p_values.append(np.nan)
    print(p_values)
    return p_values

def plot_p_value_histogram(p_values):
    plt.figure(figsize=(10, 6))
    sns.histplot(p_values, bins=50)
    plt.title('Histogram of p-values for Gene Response to Smoking (Gender Interaction)')
    plt.xlabel('p-value')
    plt.ylabel('Frequency')
    plt.show()

def main(file_path):
    data = prepare_data(file_path)
    p_values = perform_anova(data)
    plot_p_value_histogram(p_values)

if __name__ == "__main__":
    main('https://raw.githubusercontent.com/Arjun-08/Effects-of-smoking/refs/heads/main/Raw%20Data_GeneSpring%20(1).txt')

